import styled from "styled-components";
export const Header = styled.nav`
  background-color: #111;
  color: #fff;
  display: flex;
  align-items: center;
  padding: 0px 20px;
  font-size: 16px;
  height: 70px;
  border: none;
  justify-content: space-between;
  label {
    width: 34px;
    height: 34px;
    background: gray;
    display: flex;
    justify-content: center;
    align-items: center;
    border-radius: 50%;
    img.ImageMode {
      width: 23px;
    }
  }
  div {
    margin-right: 20px;
    img.ImageLogo {
      width: 80px;
    }
    a {
      text-decoration: none;
      color: #b4b4b4 !important;
      padding: 10px 20px;
      font-size: 18px;
      :hover {
        color: #fff !important;
      }
    }
  }
`;
